import React from "react";
import { useNavigate } from "react-router-dom";
import { removeToken } from "../../../login/services/login.service";

export const NavbarComponent = () => {
  const navigate = useNavigate();

  const routeLink = (route: string): any => {
    if (route === "/sign-out") {
      removeToken();
      navigate(route);
    } else {
      navigate(route);
    }
  };
  return { routeLink };
};
